Cho thuê nhà riêng 2 tầng tổng dt 48m2, khép kín, yên tĩnh thoáng mát, trong ngõ gần chợ siêu thị, công viên… Giá cho thuê 2 tr/th. MTG. 
H: C. Hương, A. Hùng; 
ĐC: Khối Quyết Tiến,<a href="/cho-thue-nha-rieng-phuong-van-phuc-1"> Vạn Phúc</a>, Hà Đông (đi qua cầu cong đối diện siêu thị vinatex cũ, gần cầu am). Nếu xem nhà gọi cho bạn tên Ngọc đang thuê nhà đến hết tháng10.

Cho thuê nhà riêng 3 tầng - 1 tum khu vực Láng - Ngã Tư Sở bao gồm: Ngõ 31 phố cầu mới.
1. Nhà đẹp 2 mặt thoáng; Ngõ thông 2 phía đường Láng và phố Cầu Mới;
2. Diện tích 40m2/ 1 tầng x 3 tầng - Mỗi tầng 2 phòng;
3. Các tiện ích đi kèm:
- Điều hòa đầy đủ các phòng;
- Tủ bếp với đầy đủ các tiện nghi đi kèm;
- Bàn ăn đủ cho ít nhất 6 người;
- Máy giặt, tủ lạnh, giường ngủ và tủ quần áo;
- Sân phơi quần áo thoáng mát đầy đủ.
Giá 9tr/tháng.
